import React, { useEffect, useState } from 'react';
import { useSelector, useDispatch, } from "react-redux";


function Home() {
    const account = useSelector((state) => state.account);
    console.log('account',account);
    return (
        <div>
            <table>
                <tr>
                    <th>pubName</th>
                    <th>AgeRat</th>
                    <th>magName</th>
                    <th>Con</th>
                </tr>
                {account.map((item,index)=>
                <tr key={index}>
                    <td>{item.pubName}</td>
                    <td>{item.AgeRat}</td>
                    <td>{item.magName}</td>
                    <td>{item.Con}</td>
                </tr>
                )}
            </table>
            
        </div>
    )
}

export default Home
